function plot() {
	document.getElementById("page").innerHTML = ((npage > 0) ? (ipage + 1) : 0) + "/" + npage;
	if ((ipage < 0) || (npage <= 0) || (ipage >= npage)) return;

			context.moveTo(Data[ipage][n][1], Height - Data[ipage][n][2]);

			context.closePath();

			context.save();

function prev() {

function last() {

function allpage() {
